package TestFiles;

import java.util.*;


public class HashMapTest {
    public static void main(String[] args) {
        String s1 ="hhbywxfzydbppjxnbhezsxepfexkzofxyqdvcgdvgnjbvihgufvgtuxtpioxgjuwawkbaerbsirrktcjces" +
                "epcocaglbassivfbjhikynfsvlbtkawstrclbkpuldshfgfvwjawownulsggsxhhqglbhjlgltfrqyjntgldlg" +
                "";
        String s2 ="";
        System.out.println(isAnagram(s1, s2));

    }
    public static boolean isAnagram(String s, String t) {
        if(s.length() != t.length()){
            return false;
        }
        char[] sCharArr = s.toCharArray();
        char[] tCharArr = t.toCharArray();
        Map<Character,Integer> map1 =new HashMap<>();//key：字符 value：字符数量
        Map<Character,Integer> map2 =new HashMap<>();
        for(char sChar : sCharArr){
            int count = map1.getOrDefault(sChar, 0) + 1;
            map1.put(sChar, count);
        }
        for(char tChar : tCharArr){
            int count = map2.getOrDefault(tChar, 0) + 1;
            map2.put(tChar, count);
        }

        for(char tChar : tCharArr){
            if(map1.get(tChar) != map2.get(tChar)){
                return false;
            }
        }
        return true;
//        return map1.equals(map2);
    }

}
